[{"location":"","page":"Home","title":"Home","text":"CurrentModule = CCNs","category":"page"},{"location":"#CCNs","page":"Home","title":"CCNs","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for CCNs.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [CCNs]","category":"page"},{"location":"#CCNs.CCN","page":"Home","title":"CCNs.CCN","text":"CCN\n\nA representation of a CMS Certification Number.\n\nCCNs are a uniform way of identifying providers or suppliers who currently or who ever have participated in the Medicare or Medicaid programs. A CCN is a 6- or 10-character alphanumeric string that encodes the provider or supplier's (respectively) State and facility type.\n\nCCNs can be constructed from AbstractString or Integer objects, but Integers can only represent a subset of all possible CCNs.\n\nCCNs inherit from AbstractString, so methods like length, get, etc. are all defined and work as if the CCN were a string identifier.\n\nCCNs are defined by CMS Manual System publication number 100-07 \"State Operations Provider Certification\".\n\n\n\n\n\n","category":"type"},{"location":"#CCNs.ccn-Tuple{Type{SupplierCCN}, AbstractString}","page":"Home","title":"CCNs.ccn","text":"ccn([T::Type], s)\n\nConstruct a CCN from input s.\n\nArguments\n\n- `T::Type` (optional) - The type of the CCN. If no type is given, the best guess of the type will be made based on the format of the input `s`.\n- `s::Union{AbstractString,Integer}` - The input to parse to create the CCN.\n\nReturn value\n\nReturns a CCN of concrete type T if given, else the type will be inferred from format of s.\n\n\n\n\n\n","category":"method"},{"location":"#CCNs.decode-Tuple{IO, MedicareProviderCCN}","page":"Home","title":"CCNs.decode","text":"decode([io::IO = stdout], ccn)\n\nDecode ccn and write the information to io.\n\n\n\n\n\n","category":"method"},{"location":"#CCNs.infer_ccn_type-Tuple{AbstractString}","page":"Home","title":"CCNs.infer_ccn_type","text":"infer_ccn_type(s) -> `Type{T} where T <: CCN`\n\nInfer the type of the CCN from the input.\n\nArguments\n\n- `s::Union{AbstractString,Integer}` - The value to parse.\n\nReturn value\n\nThe inferred type. Throws if the type cannot be inferred from the input.\n\n\n\n\n\n","category":"method"}]
